import omit from "lodash/omit";
import observable, { Observable, signal } from "observable";
import { CSSProperties } from "react";
import { mapObject } from "util";
import { ComponentModel, NodeData } from "./ComponentModel";
import { ActionModel } from "./EventModel";
import { applyFormula, isFormula } from "./formula/formula";
import {
  NodeModel,
  NodeStyleModel,
  resolveStyleBlock,
  StyleVariant,
  variantSelector,
} from "./NodeModel";
import { css } from "./stitches";
export const renderComponent = (
  parent: HTMLElement,
  name: string,
  components: Record<string, ComponentModel>
) => {
  const attributesSignal = signal<Record<string, any>>();
  attributesSignal({});
  const fragment = createComponent(name, components, attributesSignal);
  parent.appendChild(fragment);
};
const createComponent = (
  name: string,
  components: Record<string, ComponentModel>,
  attributesSignal: Observable<Record<string, any>>
): DocumentFragment => {
  const component = components[name];
  const parent = document.createDocumentFragment();
  if (!component) {
    return parent;
  }
  const variablesSignal = signal<Record<string, any>>();
  variablesSignal(
    Object.fromEntries(
      component.variables.map((variable) => [
        variable.name,
        applyFormula(variable.initialValue, {}),
      ])
    )
  );

  const dataSignal: Observable<NodeData> = observable.compute(
    [attributesSignal, variablesSignal],
    (Attributes, Variables) => ({
      Variables,
      Props: Attributes,
    })
  );

  const handleAction = (action: ActionModel, data: NodeData) => {
    switch (action.type) {
      case "Update Variable": {
        const current = variablesSignal();
        variablesSignal({
          ...current,
          [action.variableName]: applyFormula(action.value, data),
        });
      }
    }
  };

  const createNode = (
    node: NodeModel,
    dataSignal: Observable<NodeData>
  ): Element | DocumentFragment => {
    switch (node.type) {
      case "element": {
        const elem = document.createElement(node.tag);
        elem.setAttribute("data-id", node.id);
        elem.classList.add((css as any)(resolveStyle(node.style))());
        Object.entries(node.attrs).forEach(([attr, value]) => {
          switch (attr) {
            case "classList":
              node.attrs.classList?.forEach((elemClass) => {
                if (elemClass.formula) {
                  const classSignal = observable.transform(dataSignal, (data) =>
                    Boolean(applyFormula(elemClass.formula, data))
                  );
                  classSignal((show) =>
                    show
                      ? elem.classList.add(elemClass.name)
                      : elem.classList.remove(elemClass.name)
                  );
                } else {
                  elem.classList.add(elemClass.name);
                }
              });
              break;
            case "value": {
              if (isFormula(value)) {
                const o = observable.transform(dataSignal, (data) =>
                  String(applyFormula(value, data))
                );
                o((val) => {
                  (elem as HTMLInputElement).value = val;
                });
              }
            }
            case "href":
            default: {
              if (isFormula(value)) {
                const o = observable.transform(dataSignal, (data) =>
                  String(applyFormula(value, data))
                );
                o((val) => {
                  elem.setAttribute(attr, val);
                });
              }
            }
          }
        });
        node.events.forEach((event) => {
          const handler = (e: Event) => {
            if (event.preventDefault) {
              e.preventDefault();
            }
            if (event.stopPropagation) {
              e.stopPropagation();
            }
            event.actions.forEach((action) =>
              handleAction(action, { ...dataSignal(), Event: e })
            );
          };
          elem.addEventListener(
            event.trigger === "Change" ? "input" : event.trigger.toLowerCase(),
            handler
          );
        });
        node.children.forEach((childId) =>
          renderNode(childId, dataSignal, elem)
        );
        return elem;
      }
      case "text": {
        const elem = document.createElement("span");
        elem.classList.add((css as any)(resolveStyle(node.style))());
        if (isFormula(node.value)) {
          const sig = observable.transform(dataSignal, (data) =>
            String(applyFormula(node.value, data))
          );
          (elem as any).cleanUp = sig((value) => (elem.innerText = value));
        } else {
          elem.innerText = String(node.value);
        }
        return elem;
      }
      case "fragment": {
        const elem = document.createDocumentFragment();
        node.children.forEach((childId) =>
          renderNode(childId, dataSignal, elem)
        );
        return elem;
      }
      case "component": {
        const attributesSignal = observable.transform(dataSignal, (data) => {
          return mapObject(node.attrs, ([attr, value]) => [
            attr,
            applyFormula(attr, data),
          ]);
        });
        const elem = createComponent(node.name, components, attributesSignal);
        return elem;
      }
    }
  };

  const renderNode = (
    id: string,
    dataSignal: Observable<NodeData>,
    parent: Element | DocumentFragment
  ): void => {
    const node = component.nodes[id];
    if (!node) {
      return;
    }
    if (node.repeat) {
      let instances: (Element | DocumentFragment)[] = [];
      const listLengthSignal = observable.transform(
        dataSignal,
        (data) => applyFormula(node.repeat, data)?.length ?? 0
      );

      listLengthSignal(() => {
        instances.forEach((child) => {
          parent.removeChild(child);
        });
        instances = [];

        applyFormula(node.repeat, dataSignal())?.forEach?.(
          (item: any, index: number) => {
            const inst = createNode(
              node,
              observable.transform(dataSignal, (data) => ({
                ...data,
                ListItem: applyFormula(node.repeat, data)?.[index],
              }))
            );
            instances.push(inst);
            parent.appendChild(inst);
          }
        );
      });
    } else {
      const elem = createNode(node, dataSignal);
      if (node.condition) {
        const showSignal = observable.transform(dataSignal, (data) =>
          Boolean(applyFormula(node.condition, data))
        );
        showSignal((show) => {
          if (show) {
            return parent.appendChild(elem);
          }
          if (elem.parentNode === parent) {
            parent.removeChild(elem);
          }
        });
      } else {
        parent.appendChild(elem);
      }
    }
  };

  renderNode("ROOT", dataSignal, parent);
  return parent;
};

const resolveStyle = (style: NodeStyleModel): CSSProperties => {
  const { variants, breakpoints, ...rest } = style;

  const getVariantStyles = (vaariants: StyleVariant[] | undefined) =>
    variants?.reduce((acc: Record<string, NodeStyleModel>, variant) => {
      acc[variantSelector(variant)] = resolveStyleBlock(variant.style);
      return acc;
    }, {});
  return {
    position: "relative",
    ...resolveStyleBlock(rest),
    ...getVariantStyles(variants),
    ...(breakpoints?.["@large"]
      ? {
          "@large": {
            ...resolveStyleBlock(omit(breakpoints["@large"], ["variants"])),
            ...getVariantStyles(breakpoints["@large"].variants),
          },
        }
      : {}),
    ...(breakpoints?.["@medium"]
      ? {
          "@medium": {
            ...resolveStyleBlock(omit(breakpoints["@medium"], ["variants"])),
            ...getVariantStyles(breakpoints["@medium"].variants),
          },
        }
      : {}),
    ...(breakpoints?.["@small"]
      ? {
          "@small": {
            ...resolveStyleBlock(omit(breakpoints["@small"], ["variants"])),
            ...getVariantStyles(breakpoints["@small"].variants),
          },
        }
      : {}),
  };
};
